// index.js

import React from 'react';
import ReactDOM from 'react-dom';
import StateProps from './StateProps';

// Mendefinisikan CSS dalam bentuk string menggunakan template literals
const styles = `
  body {
    font-family: Arial, sans-serif;
    margin: 0;
    padding: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background-color: #f0f0f0;
  }

  .container {
    text-align: center;
  }

  .title {
    font-size: 24px;
    font-weight: bold;
    margin-bottom: 20px;
    color: #333;
  }

  .subtitle {
    font-size: 18px;
    color: #666;
  }

  .button {
    padding: 10px 20px;
    background-color: #007bff;
    color: #fff;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    font-size: 16px;
    transition: background-color 0.3s ease;
  }

  .button:hover {
    background-color: #0056b3;
  }
`;

// Membuat elemen <style> untuk menyisipkan CSS ke dalam DOM
const styleElement = document.createElement('style');
styleElement.innerHTML = styles;
document.head.appendChild(styleElement);

ReactDOM.render(
  <React.StrictMode>
    <StateProps/>
  </React.StrictMode>,
  document.getElementById('root')
);
